const uniqueUrls = [...new Set(urls.map(url => url.trim()).filter(url => {
  try {
    new URL(url);
    return true;
  } catch {
    return false;
  }
}))];

const getNameFromUrl = (url: string): string => {
  try {
    const urlObj = new URL(url);
    let hostname = urlObj.hostname.replace(/^www\./, '');
    let pathParts = urlObj.pathname.split('/').filter(Boolean);
    
    if (hostname.includes('github.com') && pathParts.length > 1) {
      return pathParts[1].replace(/-/g, ' ').replace(/_/g, ' ');
    }
    if (hostname.includes('start.me') && pathParts.length > 1) {
      return pathParts[1].replace(/-/g, ' ').replace(/_/g, ' ');
    }
    
    let name = hostname.split('.')[0];
    if (name === 'docs' && hostname.includes('google.com')) return 'Google Doc';
    if (name.length < 4 && pathParts.length > 0) {
       name = pathParts[0];
    }

    return name.charAt(0).toUpperCase() + name.slice(1).replace(/-/g, ' ');
  } catch (e) {
    return "Herramienta Desconocida";
  }
};

const categorizeUrl = (url: string): string => {
  const lowerUrl = url.toLowerCase();

  // Reglas específicas primero
  if (lowerUrl.includes('github.com')) return 'Repositorios de GitHub';
  if (lowerUrl.includes('start.me')) return 'Frameworks y Colecciones OSINT';

  // Categorías de IA
  if (lowerUrl.includes('podcast') || lowerUrl.includes('audio') || lowerUrl.includes('voice') || lowerUrl.includes('video') || lowerUrl.includes('veed') || lowerUrl.includes('fliki')) return 'IA: Audio y Video';
  if (lowerUrl.includes('art') || lowerUrl.includes('image') || lowerUrl.includes('photo') || lowerUrl.includes('logo') || lowerUrl.includes('design') || lowerUrl.includes('midjourney') || lowerUrl.includes('firefly') || lowerUrl.includes('craiyon') || lowerUrl.includes('playgroundai')) return 'IA: Generación de Imágenes y Arte';
  if (lowerUrl.includes('copy') || lowerUrl.includes('writer') || lowerUrl.includes('content') || lowerUrl.includes('prompt') || lowerUrl.includes('text') || lowerUrl.includes('jasper') || lowerUrl.includes('rytr')) return 'IA: Generación de Contenido';
  if (lowerUrl.includes('ai') || lowerUrl.includes('gpt') || lowerUrl.includes('bardeen') || lowerUrl.includes('notion.so') || lowerUrl.includes('coda.io') || lowerUrl.includes('taskade')) return 'IA: Productividad y Automatización';

  // Categorías OSINT
  if (lowerUrl.includes('search') || lowerUrl.includes('google') || lowerUrl.includes('bing') || lowerUrl.includes('yandex') || lowerUrl.includes('duckduckgo') || lowerUrl.includes('dork')) return 'Motores de Búsqueda y Dorking';
  if (lowerUrl.includes('social') || lowerUrl.includes('user') || lowerUrl.includes('phone') || lowerUrl.includes('email') || lowerUrl.includes('people') || lowerUrl.includes('pipl')) return 'Inteligencia de Personas (SOCMINT)';
  if (lowerUrl.includes('crypto') || lowerUrl.includes('bitcoin') || lowerUrl.includes('blockchain') || lowerUrl.includes('finance') || lowerUrl.includes('opencorporates')) return 'Criptomonedas y Finanzas';
  if (lowerUrl.includes('domain') || lowerUrl.includes('dns') || lowerUrl.includes('ip') || lowerUrl.includes('shodan') || lowerUrl.includes('censys') || lowerUrl.includes('urlscan')) return 'Dominios, IP y Análisis Web';
  if (lowerUrl.includes('map') || lowerUrl.includes('geo') || lowerUrl.includes('flightradar') || lowerUrl.includes('marinetraffic') || lowerUrl.includes('earth')) return 'Geolocalización y Mapas (GEOINT)';
  if (lowerUrl.includes('exploit') || lowerUrl.includes('virustotal') || lowerUrl.includes('malware') || lowerUrl.includes('threat') || lowerUrl.includes('security')) return 'Ciberseguridad y Threat Intel';
  if (lowerUrl.includes('leak') || lowerUrl.includes('darknet') || lowerUrl.includes('pwned') || lowerUrl.includes('darksearch') || lowerUrl.includes('raidforums') || lowerUrl.includes('onion')) return 'Darknet y Fugas de Datos';
  if (lowerUrl.includes('privacy') || lowerUrl.includes('secure') || lowerUrl.includes('vpn') || lowerUrl.includes('torproject') || lowerUrl.includes('whonix')) return 'Privacidad y Comunicaciones Seguras';
  if (lowerUrl.includes('learn') || lowerUrl.includes('guide') || lowerUrl.includes('handbook') || lowerUrl.includes('doc') || lowerUrl.includes('tutorial') || lowerUrl.includes('course')) return 'Recursos de Aprendizaje y Documentación';
  if (lowerUrl.includes('osintframework') || lowerUrl.includes('osint.sh') || lowerUrl.includes('blog')) return 'Frameworks y Colecciones OSINT';
  
  return 'Herramientas de Desarrollo y Productividad';
};


export const realTools: Tool[] = uniqueUrls.map((url, index) => {
  const category = categorizeUrl(url);
  return {
    id: String(index),
    name: getNameFromUrl(url),
    description: `Herramienta de ${category.toLowerCase()} disponible en: ${new URL(url).hostname}`,
    category: category,
    url: url,
    rating: parseFloat((Math.random() * (4.9 - 3.5) + 3.5).toFixed(1)),
    tags: [category.split(' ')[0].toLowerCase().replace(/,/g, '')],
    isPremium: Math.random() < 0.05, // 5% de probabilidad de ser premium
  };
});

export const getCategoriesFromTools = (tools: Tool[]) => {
    const categoryCounts = tools.reduce((acc, tool) => {
      acc[tool.category] = (acc[tool.category] || 0) + 1;
      return acc;
    }, {} as Record<string, number>);
    
    return Object.entries(categoryCounts)
      .map(([name, count]) => ({ name, count }))
      .sort((a, b) => b.count - a.count);
}
